import React from 'react';

import {Icon , Input} from '../Atom';



function MoleculeInput(props) {
   
    
    return (
       <><Input {...props} 
       className='w-100 mb-5'
       >
       
       <Icon baseClassName="fas" className="fa-plus-circle" />
<Icon baseClassName="fas" className="fa-plus-circle" color="primary" />
<Icon
  baseClassName="fas"
  className="fa-plus-circle"
  sx={{ color: green[500] }}
/>
<Icon baseClassName="fas" className="fa-plus-circle" fontSize="small" />
<Icon baseClassName="fas" className="fa-plus-circle" sx={{ fontSize: 30 }} />
       </Input>
       </>
       
      
      
    );
};

export default MoleculeInput;
